		var nftHowRare = document.createElement("div");
		nftHowRare.classList.add("nft-howrare");
		nftHowRare.textContent = "Howrare: " + nft.howrare;

		var nftMoonRank = document.createElement("div");
		nftMoonRank.classList.add("nft-moonrank");
		nftMoonRank.textContent = "Moonrank: " + nft.moonrank;

		nftCard.appendChild(nftImage);
		nftCard.appendChild(nftNumber);
		nftCard.appendChild(nftHowRare);
		nftCard.appendChild(nftMoonRank);
		nftContainer.appendChild(nftCard);

		// Attach click event listener to open the modal
		nftCard.addEventListener("click", function(nft) {
		  return function() {
			openModal(nft);
		  };
		}(nft));
	  }

	  displayedNFTs += nftsPerPage;

	  // Hide the load more button if all NFTs have been displayed
	  if (displayedNFTs >= nfts.length) {
		loadMoreButton.style.display = "none";
	  }
	}


	function searchNFTs() {
		var searchInput = document.getElementById("search-input").value.trim().toLowerCase();
		nfts = originalNFTs.slice(); // Restore the original NFT list before filtering
		if (searchInput !== "") {
			nfts = nfts.filter(function(nft) {
				return nft.number.toLowerCase().includes(searchInput);
			});
		}
		displayedNFTs = 0; // Reset the displayed NFTs counter
		nftContainer.innerHTML = ""; // Clear the existing NFT container
		displayNFTs(); // Display the filtered NFTs

		if (searchInput === "") {
			nfts = originalNFTs.slice(); // Restore the original NFT list
			nfts.sort(function(a, b) {
				return a.howrare - b.howrare; // Sort by rarity, smallest to largest
			});
			displayedNFTs = 0; // Reset the displayed NFTs counter
			nftContainer.innerHTML = ""; // Clear the existing NFT container
			displayNFTs(); // Display the original NFTs sorted by rarity
			loadMoreButton.style.display = "block"; // Ensure the "Load More" button is visible
		}
	}
    // Attach event listener to the load more button
    loadMoreButton.addEventListener("click", displayNFTs);

	// Attach event listener to the search input
    document.getElementById("search-input").addEventListener("input", searchNFTs);

	function clearSearch() {
	  // Clear the search input
	  searchInput.value = "";

	  // Reload the NFTs based on the original sorting
	  loadNFTs(originalNFTs, sortByDropdown.value);
	}
	
	clearSearchButton.addEventListener("click", function() {
		document.getElementById("search-input").value = ""; // Clear the search input
		searchNFTs(); // Perform search
		document.getElementById("sort-dropdown").value = "howrare";
	});
	
	document.getElementById("sort-dropdown").addEventListener("change", function() {
		var sortType = this.value;
		displayedNFTs = 0; // Reset the displayed NFTs counter
		nftContainer.innerHTML = ""; // Clear the existing NFT container
		sortNFTs(); // Sort the NFTs based on the selected sort type
		displayNFTs(); // Display the sorted NFTs
	});


	function openModal(nft) {
	  var modal = document.getElementById("modal");
	  var modalContent = document.querySelector(".modal-content");
	  var modalClose = document.getElementById("modal-close");
	  var modalNFTImage = document.getElementById("modal-nft-image");
	  var modalNFTNumber = document.getElementById("modal-nft-number");
	  var modalNFTHowRare = document.getElementById("modal-nft-howrare");
	  var modalNFTMoonRank = document.getElementById("modal-nft-moonrank");
	  var modalNFTAdditional = document.getElementById("modal-nft-additional");

	// Set the NFT image in the modal
	  modalNFTImage.innerHTML = '<img src="' + nft.image + '" alt="NFT Image">';


	  // Set the additional attributes in the modal
	  var additionalAttributes = "";
	  for (var attribute in nft) {
		if (attribute !== "image" && attribute !== "number" && attribute !== "howrare" && attribute !== "moonrank") {
		  additionalAttributes += "<div><strong><span style='color: #e873ff;'>" + attribute + ":</span>&nbsp;&nbsp;<span style='color: #53fffc;'>" + nft[attribute] + "</span></strong></div>";
		}
	  }
	  
	  // Set the NFT details in the modal
	  modalNFTNumber.innerHTML = "<strong><span style='color: #53fffc;'>" + nft.number + "</span></strong><br>" + "<strong><span style='color: #e873ff;'>Howrare: </span>" + ": &nbsp;&nbsp; <span style='color: #53fffc;'>" + nft.howrare + "</span></strong><br>" + "<strong><span style='color: #e873ff;'>Moonrank: </span>" + ": &nbsp;&nbsp; <span style='color: #53fffc;'>" + nft.moonrank + "</span></strong><br><br>" + additionalAttributes;
	  
	  
	  // Show the modal if it is not already visible
	  if (modal.style.display !== "block") {
		modal.style.display = "block";
	  }

	  // Close the modal when the close button is clicked
	  modalClose.addEventListener("click", function() {
		modal.style.display = "none";
	  });
	}

	// Close the modal when the close button or outside modal is clicked
	var modal = document.getElementById("modal");
	var closeBtn = document.getElementById("modal-close-btn");
	modal.addEventListener("click", function(event) {
	  if (event.target === modal || event.target === closeBtn) {
		modal.style.display = "none";
	  }
	});

	// Attach click event listeners to each NFT card
	var nftCards = document.getElementsByClassName("nft-card");
	Array.from(nftCards).forEach(function(nftCard) {
	  nftCard.addEventListener("click", function(event) {
		var nftNumber = event.currentTarget.querySelector(".nft-number");
		var nftImage = event.currentTarget.querySelector(".nft-image");
		var nftHowRare = event.currentTarget.querySelector(".nft-howrare");
		var nftMoonRank = event.currentTarget.querySelector(".nft-moonrank");
		
		var nft = {
		  image: nftImage.src,
		  number: nftNumber.textContent.replace("Degens ", ""),
		  howrare: nftHowRare.textContent.replace("Howrare: ", ""),
		  moonrank: nftMoonRank.textContent.replace("Moonrank: ", "")
		};
		
		openModal(nft);
	  });
	});


	// Hide the modal on page load
	window.onload = function () {
	  modal.style.display = "none";
	};
	
	document.getElementById("sort-dropdown").value = "howrare"; // Set default value

	sortNFTs(); // Sort the NFTs initially based on the default sort type
	displayNFTs(); // Initial display of NFTs
	
	// Close the modal when the close button or outside modal is clicked
	var modal = document.getElementById("modal");
	var closeBtn = document.getElementById("modal-close");
	modal.addEventListener("click", function (event) {
	  if (event.target === modal || event.target === closeBtn) {
		modal.style.display = "none";
	  }
	});

    </script>
</body>
</html>
